.pageOn{
    border-radius: 8px;
}
.newVip{
    padding: 0 15px 11px 15px;
    .header{
        height: 39px;
        .title{
            font-size: 15px;
        }
        .more{
            font-size: 12px;
            .iconfont{
                font-size: 12px;
                margin-left: 2px;
            }
        }
    }
    .list{
        overflow: hidden;
        flex-wrap: nowrap;
        .item{
            width: 86px;
            background: #FFFFFF;
            border-radius: 6px;
            padding: 6px 6px 0 6px;
            margin-right: 6px;
            .pictrue{
                width: 74px;
                height: 74px;
                position: relative;
                img{
                    width: 100%;
                    height: 100%;
                }
                .label{
                    width: 49px;
                    height: 16px;
                    background: #E93323;
                    border-radius: 8px;
                    position: absolute;
                    bottom: 6px;
                    left:50%;
                    margin-left: -24.5px;
                    font-size: 12px;
                    color: #fff;
                    text-align: center;
                    line-height: 16px;
                }
            }
            .money{
                font-weight: 500;
                color: #E93323;
                font-size: 12px;
                margin-top: 3px;
            }
            .y_money{
                font-weight: 400;
                color: #CCCCCC;
                font-size: 10px;
                text-decoration: line-through;
            }
        }
    }
}
